// src/App.js
import React from 'react';
import logo from './logo.svg';
import  RoleBasedAccessComponent from './components/RoleBasedAccessModule';
import TimeTrackingComponent from './components/TimeTrackingComponent';
import PerformanceMetricsComponent from './components/PerformanceMetricsComponent';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

        {/* Custom Components */}
        <TimeTrackingComponent />
        <PerformanceMetricsComponent />
        <RoleBasedAccessComponent/>
      </header>
    </div>
  );
}

export default App;
